import{_ as a,o,c as r,b as l,a as e,d as i,e as t,r as n}from"./app.2d179ac6.js";const s={},c=l("h1",{id:"jvm\u5185\u5B58\u7BA1\u7406",tabindex:"-1"},[l("a",{class:"header-anchor",href:"#jvm\u5185\u5B58\u7BA1\u7406","aria-hidden":"true"},"#"),i(" JVM\u5185\u5B58\u7BA1\u7406")],-1),h=i("["),d={href:"http://www.cnblogs.com/zuoxiaolong",target:"_blank",rel:"noopener noreferrer"},_=i("\u535A\u5BA2\u56ED\u5DE6\u6F47\u9F99\u7684\u6280\u672F\u535A\u5BA2"),u=i("]"),g={href:"https://www.cnblogs.com/aishangJava/p/9541920.html",target:"_blank",rel:"noopener noreferrer"},m=i("\u5DE5\u7A0B\u5E08\u6401\u6D45"),f=t('<h2 id="jvm\u5185\u5B58\u7BA1\u7406\u6982\u8FF0" tabindex="-1"><a class="header-anchor" href="#jvm\u5185\u5B58\u7BA1\u7406\u6982\u8FF0" aria-hidden="true">#</a> JVM\u5185\u5B58\u7BA1\u7406\u6982\u8FF0</h2><h3 id="\u5185\u5B58\u5212\u5206" tabindex="-1"><a class="header-anchor" href="#\u5185\u5B58\u5212\u5206" aria-hidden="true">#</a> \u5185\u5B58\u5212\u5206</h3><p>\u865A\u62DF\u673A\u5C06\u5185\u5B58\u5206\u4E3A\u516D\u5927\u90E8\u5206\u3002</p><ul><li><p>pc\u5BC4\u5B58\u5668</p><p>\u7EBF\u7A0B\u72EC\u6709\u3002\u5168\u79F0\u662F\u7A0B\u5E8F\u8BA1\u6570\u5BC4\u5B58\u5668\uFF0C\u8BB0\u8F7D\u6BCF\u4E00\u4E2A\u7EBF\u7A0B\u8FD0\u884C\u7684java\u65B9\u6CD5\u7684\u5730\u5740\uFF0C\u5982\u679C\u6267\u884C\u7684\u662F\u672C\u5730\u65B9\u6CD5\uFF0C\u7A0B\u5E8F\u8BA1\u6570\u5668\u4F1A\u662F\u4E00\u4E2A\u7A7A\u5730\u5740\u3002\u4F5C\u7528\u662F\u652F\u6301\u591A\u7EBF\u7A0B\uFF0C\u8BB0\u4F4F\u6BCF\u4E2A\u7EBF\u7A0B\u6267\u884C\u7684\u4F4D\u7F6E\uFF0C\u4E5F\u5C31\u662F\u6BCF\u4E2A\u7EBF\u7A0B\u90FD\u4F1A\u6709\u4E00\u4E2A\u7A0B\u5E8F\u8BA1\u6570\u5668\u3002</p></li><li><p>java\u865A\u62DF\u673A\u6808</p><p>\u7EBF\u7A0B\u72EC\u6709\u3002\u5728\u521B\u5EFA\u7EBF\u7A0B\u7684\u65F6\u5019\u521B\u5EFA\uFF0C\u7528\u4E8E\u5B58\u50A8\u6808\u5E27\u3002</p><ol><li>\u6808\u5E27\uFF0C\u65B9\u6CD5\u8FD0\u884C\u65F6\uFF0C\u4E34\u65F6\u7684\u6570\u636E\u5B58\u50A8\u533A\u57DF\u3002\u5305\u542B\u6570\u636E\u548C\u90E8\u5206\u7684\u8FC7\u7A0B\u7ED3\u679C\uFF0C\u4E0E\u6B64\u540C\u65F6\u5B83\u53C8\u80A9\u8D1F\u5904\u7406\u65B9\u6CD5\u8FD4\u56DE\u503C\u3001\u52A8\u6001\u94FE\u63A5\u548C\u5F02\u5E38\u5206\u6D3E\u7684\u4EFB\u52A1\u3002\u968F\u7740\u65B9\u6CD5\u7684\u521B\u5EFA\u800C\u521B\u5EFA\uFF0C\u65B9\u6CD5\u7684\u7ED3\u675F\u800C\u9500\u6BC1\uFF1B\u5982\u679C\u65B9\u6CD5\u629B\u51FA\u5F02\u5E38\uFF0C\u4E5F\u4F1A\u8FDB\u884C\u9500\u6BC1\u3002</li><li>\u5C40\u90E8\u53D8\u91CF\u8868\uFF0C\u65B9\u6CD5\u5C40\u90E8\u53D8\u91CF\u7684\u5217\u8868\uFF0C\u76F8\u5F53\u4E8E\u4E00\u4E2A\u5BF9\u8C61\u6570\u7EC4\u3002</li><li>\u64CD\u4F5C\u6570\u6808\uFF0C\u540E\u8FDB\u5148\u51FA(LIFO)\u7684\u6808\uFF0C\u957F\u5EA6\u5728\u7F16\u8BD1\u5668\u5C31\u5199\u5165class\u6587\u4EF6\u4E2D\uFF0C\u662F\u56FA\u5B9A\u957F\u5EA6\u3002\u63D0\u4F9B\u5B57\u8282\u7801\u6307\u4EE4\u64CD\u4F5C\u53D8\u91CF\u8BA1\u7B97\u7684\u7A7A\u95F4\u3002</li></ol></li><li><p>java\u5806</p><p>\u5168\u5C40\u5171\u4EAB\uFF0C\u968F\u7740\u865A\u62DF\u673A\u7684\u542F\u52A8\u521B\u5EFA\uFF0C\u50A8\u5B58\u6240\u6709\u7684\u5BF9\u8C61\u5B9E\u4F8B\u548C\u6570\u7EC4\u5BF9\u8C61\uFF0C\u5185\u7F6E\u4E86\u201C\u81EA\u52A8\u5185\u5B58\u7BA1\u7406\u7CFB\u7EDF\u201D\uFF0C\u4E5F\u5C31\u662F\u5783\u573E\u6536\u96C6\u5668(GC)\u3002</p></li><li><p>\u65B9\u6CD5\u533A</p><p>\u5168\u5C40\u5171\u4EAB\uFF0C\u4E3B\u8981\u50A8\u5B58\u8FD0\u884C\u65F6\u5E38\u91CF\u6C60\uFF0C\u5B57\u6BB5\u4FE1\u606F\uFF0C\u65B9\u6CD5\u4FE1\u606F\uFF0C\u6784\u9020\u65B9\u6CD5\u548C\u666E\u901A\u51FD\u6570\u7684\u5B57\u8282\u7801\u5185\u5BB9\u4EE5\u53CA\u4E00\u4E9B\u7279\u6B8A\u7684\u65B9\u6CD5\u3002\u4E0Ejava\u5806\u7684\u533A\u522B\u9664\u4E86\u5B58\u50A8\u7684\u4E1C\u897F\u4E0D\u540C\uFF0C\u6700\u5927\u7684\u533A\u522B\u662F\u4E0D\u5F3A\u5236\u8981\u6C42\u5B9E\u73B0GC\u3002</p></li><li><p>\u8FD0\u884C\u65F6\u5E38\u91CF\u6C60</p></li><li><p>\u672C\u5730\u65B9\u6CD5\u6808</p><p>\u7EBF\u7A0B\u72EC\u6709\uFF0C\u652F\u6301native\u65B9\u6CD5\u7684\u6267\u884C\u3002</p></li></ul><h2 id="gc\u7B80\u4ECB" tabindex="-1"><a class="header-anchor" href="#gc\u7B80\u4ECB" aria-hidden="true">#</a> GC\u7B80\u4ECB</h2><p>\u524D\u63D0\uFF1A\u4E3A\u4E86\u907F\u514D\u5185\u5B58\u6EA2\u51FA\u548C\u5185\u5B58\u6CC4\u6F0F\u3002</p><p>\u89E3\u51B3\u7684\u95EE\u9898\uFF1A</p><ul><li>\u54EA\u4E9B\u5BF9\u8C61\u53EF\u4EE5\u88AB\u56DE\u6536</li><li>\u4EC0\u4E48\u65F6\u5019\u56DE\u6536\u5BF9\u8C61</li><li>\u91C7\u7528\u4EC0\u4E48\u65B9\u5F0F\u8FDB\u884C\u56DE\u6536</li></ul><h2 id="gc\u7B97\u6CD5" tabindex="-1"><a class="header-anchor" href="#gc\u7B97\u6CD5" aria-hidden="true">#</a> GC\u7B97\u6CD5</h2><ul><li><p>\u5F15\u7528\u8BA1\u6570\u7B97\u6CD5</p><p>\u6548\u7387\u6700\u9AD8\uFF0C\u5BF9\u4E8E\u5FAA\u73AF\u5F15\u7528\u7684\u5BF9\u8C61\u65E0\u6CD5\u8FDB\u884C\u56DE\u6536\u3002</p></li><li><p>\u6839\u641C\u7D22\u7B97\u6CD5</p><p>\u5F25\u8865\u5F15\u7528\u8BA1\u6570\u7B97\u6CD5\u7684\u7F3A\u9677\uFF0C\u8BBE\u7ACB\u82E5\u5E72\u6839\u8282\u70B9\uFF0C\u5F53\u4EFB\u4F55\u4E00\u4E2A\u6839\u5BF9\u8C61\u5230\u67D0\u4E00\u4E2A\u5BF9\u8C61\u5747\u4E0D\u53EF\u8FBE\uFF0C\u5219\u8BA4\u4E3A\u8BE5\u5BF9\u8C61\u662F\u53EF\u4EE5\u88AB\u56DE\u6536\u7684\u3002</p><p>GC roots\u7684\u5BF9\u8C61\u6709\u4EE5\u4E0B\u51E0\u79CD\uFF1A</p><ol><li>\u865A\u62DF\u673A\u6808\u4E2D\u5F15\u7528\u7684\u5BF9\u8C61\u3002\uFF08\u672C\u5730\u53D8\u91CF\u8868\uFF09</li><li>\u65B9\u6CD5\u533A\u4E2D\u7C7B\u9759\u6001\u5C5E\u6027\u5F15\u7528\u7684\u5BF9\u8C61\u3002\uFF08static\u5B9A\u4E49\u7684\u5C5E\u6027\uFF09</li><li>\u65B9\u6CD5\u533A\u4E2D\u7684\u5E38\u91CF\u5F15\u7528\u7684\u5BF9\u8C61\u3002 \uFF08final\u5B9A\u4E49\u7684\u5C5E\u6027\uFF09</li><li>\u672C\u5730\u65B9\u6CD5\u6808\u4E2DJNI\u7684\u5F15\u7528\u5BF9\u8C61\u3002\uFF08\u672C\u5730\u53D8\u91CF\u8868\uFF09</li></ol></li><li><p>\u5783\u573E\u6536\u96C6\u7B97\u6CD5</p><p>\u6839\u641C\u7D20\u7B97\u6CD5\uFF0C\u4E3B\u8981\u89E3\u51B3\u7684\u662F\u54EA\u4E9B\u5BF9\u8C61\u53EF\u4EE5\u88AB\u56DE\u6536\uFF0C\u4F46\u662F\u4EC0\u4E48\u65F6\u5019\u56DE\u6536\uFF0C\u4EE5\u53CA\u91C7\u7528\u4EC0\u4E48\u65B9\u5F0F\u8FDB\u884C\u56DE\u6536\u3002\u56E0\u6B64\u5BF9<strong>\u6839\u641C\u7D22\u65B9\u6CD5</strong>\u8FDB\u884C\u6269\u5145\uFF0C<strong>\u6807\u8BB0-\u6E05\u9664\u7B97\u6CD5</strong>\uFF0C<strong>\u590D\u5236\u7B97\u6CD5</strong>\uFF0C<strong>\u6807\u8BB0-\u6574\u7406\u7B97\u6CD5</strong>\u3002</p><ol><li><p>\u6807\u8BB0-\u6E05\u9664\u7B97\u6CD5</p><p>\u5F53\u5806\u4E2D\u7684\u6709\u6548\u5185\u5B58\u88AB\u8017\u5C3D\u7684\u65F6\u5019\uFF0C\u5C31\u4F1A\u505C\u6B62\u6574\u4E2A\u5E94\u7528\u7A0B\u5E8F\uFF0C\u7136\u540E\u904D\u5386\u6240\u6709\u7684\u6839\u5BF9\u8C61\uFF0C\u5C06\u53EF\u8FBE\u7684\u5BF9\u8C61<strong>\u6807\u8BB0</strong>\u4E3A\u5B58\u6D3B\u5BF9\u8C61\uFF0C\u5C06\u6CA1\u6709\u6807\u8BB0\u7684\u5BF9\u8C61\u8FDB\u884C<strong>\u6E05\u9664</strong>\u3002</p><p>\u95EE\u9898\u4E00\uFF1A\u4E3A\u4EC0\u4E48\u9700\u8981\u505C\u6B62\u5E94\u7528\u7A0B\u5E8F</p><p>\u56DE\u7B54\uFF1A\u5982\u679C\u5728\u8FDB\u884CGC\u7684\u65F6\u5019\uFF0C\u521A\u597Dnew \u4E00\u4E2A\u65B0\u7684\u5BF9\u8C61\uFF0C\u6807\u8BB0\u4E3A\u4E0D\u53EF\u8FBE\u8FDB\u884C\u6E05\u9664\uFF0C\u90A3\u4E48\u5F53GC\u5B8C\u6210\u540E\uFF0C\u521A\u521B\u5EFA\u7684\u5BF9\u8C61\u5C31\u4E3Anull\u3002</p><p>\u6807\u8BB0-\u6E05\u9664\u7B97\u6CD5\u7684\u7F3A\u70B9\uFF1A</p><ul><li>\u6548\u7387\u6BD4\u8F83\u4F4E\uFF0C\u9012\u5F52\u4E0E\u5168\u5806\u904D\u5386\uFF0C\u800C\u4E14\u5728GC\u7684\u65F6\u5019\uFF0C\u4F1A\u505C\u6B62\u5E94\u7528\u7A0B\u5E8F\u3002\u8FD9\u4F1A\u5BFC\u81F4\u7528\u6237\u4F53\u9A8C\u975E\u5E38\u5DEE\u52B2\u3002</li><li>\u8FD9\u79CD\u65B9\u5F0F\u6E05\u9664\u7684\u5185\u5B58\u662F\u4E0D\u8FDE\u7EED\u7684\uFF0C\u4F1A\u9020\u6210\u5185\u5B58\u7684\u5E03\u5C40\u5341\u5206\u6DF7\u4E71\uFF0C\u4F1A\u4E3A\u7EF4\u6301\u5185\u5B58\u5E03\u5C40\u8FDB\u884C\u5176\u5B83\u7684\u5F00\u9500\u3002</li></ul></li><li><p>\u590D\u5236\u7B97\u6CD5</p><p>\u5C06\u5185\u5B58\u5212\u5206\u4E3A\u4E24\u4E2A\u533A\u95F4\uFF0C\u5728\u4EFB\u610F\u65F6\u95F4\u70B9\uFF0C\u6240\u6709\u52A8\u6001\u5206\u914D\u7684\u5BF9\u8C61\u90FD\u53EA\u80FD\u5206\u914D\u5728\u5176\u4E2D\u4E00\u4E2A\u533A\u95F4(\u6D3B\u533A\u95F4)\uFF0C\u53E6\u4E00\u4E2A\u533A\u95F4(\u7A7A\u95F2\u533A\u95F4)\u5219\u662F\u7A7A\u95F2\u7684\u3002</p><p>\u5F53\u6709\u6548\u5185\u5B58\u8017\u5C3D\u65F6\uFF0Cjvm\u5C06\u6682\u505C\u7A0B\u5E8F\u8FDB\u884C\uFF0C\u5F00\u542F\u590D\u5236\u7B97\u6CD5GC\u3002\u63A5\u4E0B\u6765GC\u7EBF\u7A0B\u4F1A\u5C06\u6D3B\u52A8\u533A\u95F4\u7684\u5B58\u6D3B\u7EBF\u7A0B\u5168\u90E8\u590D\u5236\u5230\u7A7A\u95F2\u533A\u95F4(\u6B64\u65F6\uFF0C\u9700\u8981\u88AB\u56DE\u6536\u7684\u5BF9\u8C61\u5DF2\u7ECF\u88AB\u56DE\u6536\u6389)\uFF0C\u4E14\u4E25\u683C\u6309\u7167\u5185\u5B58\u5730\u5740\u4F9D\u6B21\u6392\u5217\u3002\u6B64\u65F6\uFF0CGC\u7EBF\u7A0B\u5C06\u66F4\u65B0\u5B58\u6D3B\u5BF9\u8C61\u7684\u5185\u5B58\u5F15\u7528\u5730\u5740\u6307\u5411\u65B0\u7684\u5185\u5B58\u5730\u5740\u3002</p><p>\u590D\u5236\u7B97\u6CD5\u7684\u7F3A\u70B9\uFF1A</p><ul><li><p>\u6D6A\u8D39\u4E86\u4E00\u534A\u7684\u5185\u5B58\u3002</p></li><li><p>\u5982\u679C\u5BF9\u8C61\u7684\u5B58\u6D3B\u7387\u5F88\u9AD8\uFF0C\u9700\u8981\u5C06\u6240\u6709\u7684\u5BF9\u8C61\u590D\u5236\u4E00\u904D\uFF0C\u5E76\u5C06\u5F15\u7528\u5730\u5740\u91CD\u7F6E\u4E00\u904D\u3002\u590D\u5236\u7684\u52A8\u4F5C\u9700\u8981\u82B1\u8D39\u65F6\u95F4\uFF0C\u5728\u5B58\u6D3B\u5BF9\u8C61\u6BD4\u8F83\u591A\u7684\u65F6\u5019\uFF0C\u5C06\u4F1A\u53D8\u5F97\u4E0D\u53EF\u5FFD\u89C6\u3002</p><p>\u590D\u5236\u7B97\u6CD5\u60F3\u8981\u4F7F\u7528\uFF0C\u5185\u5B58\u5BF9\u8C61\u7684\u5B58\u6D3B\u7387\u8981\u975E\u5E38\u4F4E\u624D\u53EF\u4EE5\uFF0C\u8FD8\u8981\u5BA2\u670D\u4E00\u534A\u5185\u5B58\u7684\u6D6A\u8D39\u3002</p></li></ul></li><li><p>\u6807\u8BB0-\u6574\u7406\u7B97\u6CD5</p><p>\u4E0E\u6807\u8BB0-\u6E05\u9664\u7B97\u6CD5\u7C7B\u4F3C\uFF0C\u90FD\u662F\u5148\u904D\u5386GC roots, \u5C06\u5B58\u6D3B\u7684\u5BF9\u8C61\u8FDB\u884C\u6807\u8BB0\uFF0C\u79FB\u52A8\u6240\u6709\u7684\u5B58\u6D3B\u5BF9\u8C61\uFF0C\u4E14\u6309\u7167\u5185\u5B58\u5730\u5740\u6B21\u5E8F\u4F9D\u6B21\u6392\u5217\uFF0C\u7136\u540E\u5C06\u672B\u7AEF\u5185\u5B58\u5730\u5740\u4EE5\u540E\u7684\u5185\u5B58\u5168\u90E8\u56DE\u6536\u3002\u56E0\u6B64\u7B2C\u4E8C\u9636\u6BB5\u79F0\u4E3A\u6574\u7406\u9636\u6BB5\u3002</p><p>\u5F25\u8865\u4E86\u6807\u8BB0-\u6E05\u9664\u7B97\u6CD5\u7684\u5185\u5B58\u533A\u57DF\u5206\u6563\u7684\u7F3A\u70B9\u548C\u590D\u5236\u7B97\u6CD5\u7684\u6D88\u8017\u4E00\u534A\u5185\u5B58\u7684\u7F3A\u70B9\u3002</p><p>\u6807\u8BB0-\u6574\u7406\u7B97\u6CD5\u7684\u7F3A\u70B9\uFF1A</p><ul><li>\u6548\u7387\u4E0D\u9AD8\uFF0C\u6807\u8BB0\u6240\u6709\u7684\u5B58\u6D3B\u5BF9\u8C61\uFF0C\u8FD8\u8981\u6574\u7406\u6240\u6709\u7684\u5B58\u6D3B\u5BF9\u8C61\u7684\u5F15\u7528\u5730\u5740\u3002\u6548\u7387\u4F4E\u4E8E\u590D\u5236\u7B97\u6CD5\u3002</li></ul><p>\u603B\u7ED3\uFF1A</p><ol><li><p>\u4E09\u4E2A\u7B97\u6CD5\u90FD\u4F9D\u8D56\u6839\u641C\u7D22\u7B97\u6CD5\u5224\u65AD\u4E00\u4E2A\u5BF9\u8C61\u662F\u5426\u5E94\u8BE5\u88AB\u56DE\u6536\uFF0C\u800C\u652F\u6301\u6839\u641C\u7D22\u7B97\u6CD5\u53EF\u4EE5\u6B63\u5E38\u5DE5\u4F5C\u7684\u7406\u8BBA\u4F9D\u636E\uFF0C\u5C31\u662F\u8BED\u6CD5\u4E2D\u53D8\u91CF\u4F5C\u7528\u57DF\u7684\u76F8\u5173\u5185\u5BB9\u3002\u9632\u6B62\u5185\u5B58\u6CC4\u6F0F\uFF0C\u5C31\u8981\u638C\u63E1\u597D\u53D8\u91CF\u4F5C\u7528\u57DF\u3002</p></li><li><p>\u5728GC\u7EBF\u7A0B\u5F00\u542F\u65F6\uFF0C\u90FD\u8981\u505C\u6B62\u5E94\u7528\u7A0B\u5E8F\u3002</p><p>\u6548\u7387\uFF1A\u590D\u5236\u7B97\u6CD5&gt;\u6807\u8BB0-\u6574\u7406\u7B97\u6CD5&gt;\u6807\u8BB0-\u6E05\u9664\u7B97\u6CD5</p><p>\u5185\u5B58\u6574\u9F50\u5EA6\uFF1A\u590D\u5236\u7B97\u6CD5=\u6807\u8BB0-\u6574\u7406\u7B97\u6CD5&gt;\u6807\u8BB0-\u6E05\u9664\u7B97\u6CD5</p><p>\u5185\u5B58\u5229\u7528\u7387\uFF1A\u6807\u8BB0-\u6574\u7406\u7B97\u6CD5=\u6807\u8BB0-\u6E05\u9664\u7B97\u6CD5&gt;\u590D\u5236\u7B97\u6CD5</p></li></ol></li><li><p>\u5206\u4EE3\u6536\u96C6\u7B97\u6CD5--\u6700\u4F18\u89E3</p><p>\u5206\u4EE3\u6536\u96C6\u7B97\u6CD5\u5176\u5B9E\u662F\u5BF9\u4EE5\u4E0A\u4E09\u4E2A\u5783\u573E\u56DE\u6536\u7B97\u6CD5\u7684\u5B9E\u9645\u5E94\u7528\u3002</p><p>\u5206\u4EE3\u6536\u96C6\u7B97\u6CD5\u9488\u5BF9java\u5806\u8BBE\u8BA1\u7684\u3002</p><p>\u56DE\u6536\u65F6\u673A\uFF1A</p><p>\u200B jvm\u518D\u8FDB\u884CGC\u7684\u65F6\u5019\uFF0C\u4E0D\u662F\u5BF9\u4E0A\u8FF0\u4E09\u4E2A\u533A\u57DF\u90FD\u8FDB\u884C\u56DE\u6536\u3002</p><ul><li>\u666E\u901AGC\uFF08minor gc\uFF09: \u9488\u5BF9\u65B0\u751F\u4EE3\u533A\u57DF\u7684GC\u3002</li><li>\u5168\u5C40GC \uFF08minor gc or full gc\uFF09: \u9488\u5BF9\u8001\u5E74\u4EE3\u7684GC, \u5076\u5C14\u4F34\u968F\u5BF9\u65B0\u751F\u4EE3\u7684GC\u4EE5\u53CA\u5BF9\u6C38\u4E45\u4EE3\u7684GC\u3002</li></ul></li></ol></li></ul><h2 id="\u5783\u573E\u6536\u96C6\u5668" tabindex="-1"><a class="header-anchor" href="#\u5783\u573E\u6536\u96C6\u5668" aria-hidden="true">#</a> \u5783\u573E\u6536\u96C6\u5668</h2>',11),C={href:"https://www.cnblogs.com/zuoxiaolong/p/jvm6.html",target:"_blank",rel:"noopener noreferrer"},v=i("see current");function G(b,j){const p=n("ExternalLinkIcon");return o(),r("div",null,[c,l("blockquote",null,[l("p",null,[h,l("a",d,[_,e(p)]),u]),l("p",null,[l("a",g,[m,e(p)])])]),f,l("p",null,[l("a",C,[v,e(p)])])])}var w=a(s,[["render",G],["__file","jvm.html.vue"]]);export{w as default};
